description:
Verenigde Staten
Drama
87 minuten

goed

met Daphne Zuniga, David Sutcliffe en Chelah Horsdal

Na het aanbreken van het kerstseizoen besluit een getrouwde moeder dat het genoeg is geweest. Ze slooft zich elk jaar uit voor 
een perfecte Kerstmis, maar krijgt hier geen waardering voor. Ze gaat in staking: als haar gezin een goed kerstmaal wil, zullen 
de leden daar zelf voor moeten zorgen. Tijdens haar boycot ontvangt ze veel steun van huisvrouwen uit de buurt, maar al snel 
blijkt dat de kerstmagie juist datgene is, wat nodig is.
